import React from "react";
import { Navigate } from "react-router-dom";
import { useApp } from "../../context/AppContext.jsx";

function ProtectedRoute({ children }) {
    const { user } = useApp();

    if (!user) return <Navigate to="/" replace />;

    return children;
}

export default ProtectedRoute;
